Lego Friends Olly ve Paisley'nin Aile Evleri 42620
7 yaş ve üzeri kız ve erkek çocuklar için LEGO® Friends Olly ve Paisley'nin Aile evleri (42620) oyuncak setiyle yaratıcı oyunlar çok eğlenceli. 5 mini bebek, bir mikro bebek, 2 evcil hayvan figürü ve aksesuarlar içeren bebek evi aile setiyle çocuklar, komşu Olly ile Paisley arasındaki arkadaşlığı keşfedebilir. Bu bebek evi yapım oyuncağı, Olly ve Paisley’nin iki katlı evleri ile ikisi arasındaki ağaç evden oluşur. Olly’nin evinde beş çayı ikram etmek için aksesuarların olduğu şirin bir oturma odası ile alt katta banyo bulunur. Olly’nin odasında bir yatak ve kedisi için mama kabı, komodin ve Olly’nin moda çizimleri koleksiyonu vardır. Paisley’nin evinde yemek masası, ocak, ve yiyecek aksesuarlı bir buzdolabının olduğu bir aile mutfağı bulunur. Üst katta Paisley’nin küçük kız kardeşiyle paylaştığı odası vardır. Gitarını ve arkadaşlarının fotoğraflarını burada tutar. Bu set, eğlenceli aile oyuncaklarını ve rol yapma faaliyetlerini seven çocuklar için yaratıcı bir hediye fikridir.;

Bebek evi aile seti – LEGO® Friends Olly ve Paisley’nin Aile Evleri seti, ev ve aile oyuncakları inşa edip oynamayı seven 7 yaş ve üzeri kız ve erkek çocuklara saatlerce yaratıcı oyunlar sunar;
2 ev ve ağaç ev – Çocuklar için bu yapım oyuncağı, çok sayıda iç ve dış detaya sahip 2 adet iki katlı ev ve karakterlerin birlikte vakit geçirebileceği bir ağaç ev içerir;
8 LEGO® Friends karakteri – Farklı arkadaşlık hikayelerine ilham vermek için 5 mini bebek, bir mikro bebek, 2 evcil hayvan figürü ve çok sayıda aksesuar içerir;
Çok sayıda aksesuar içeren bir rol yapma faaliyeti oyuncağı – Sette gitar, çizimler, mutfak ve yemek yeme eşyaları gibi farklı aile ve arkadaşlık hikayelerini teşvik eden aksesuarlar bulunur;
Rol yapma faaliyetlerini seven çocuklar için bir oyuncak – Bu LEGO® Friends yapım seti, 7 yaş ve üzeri kız ve erkek çocuklar için yaratıcı bir hediye fikridir;
Yardımcı uygulama – Model severlerin yeni beceriler kazanırken modelleri 3 boyutlu olarak yakınlaştırabileceği ve döndürebileceği, ilerlemelerini takip edebileceği ve setleri kaydedebileceği LEGO® Builder uygulamasındaki sezgisel talimatları keşfedin;
Arkadaşlık hikayeleri yaratın – Çocukların gerçek hayattan maceraları canlandırırken arkadaşlar edinebileceği ve heyecan verici mekanları keşfedebileceği LEGO® Friends serisindeki diğer setlere göz atın;
Ölçüler – Bu 1126 parçalı setin yüksekliği 19 cm, genişliği 46 cm, derinliği 23 cm’dir;

Lego Star Wars 75390 Luke Skywalker
Çocuklar, Luke Skywalker X-Wing Robotu’nu (75390) inşa edip oynarken, heyecan verici LEGO® Star Wars™ evreninde Asi kahramanlarına dönüşürler. 6 yaş ve üzeri erkek ve kız çocuklar ve genç hayranlar için harika bir yaratıcı hediye olan bu duruşu ayarlanabilir, inşa edilebilen Star Wars robotu oyuncağı, fantastik aksiyon maceraları için tasarlanmıştır. Luke Skywalker LEGO minifigürü için açılan bir kokpiti, ışın kılıcı klipsli, ayarlanabilir bir X-wing jet çantası, büyük ışın kılıcını ve mermi atan blasteri tutmak için kavrayıcı elleri bulunur. Bu LEGO Star Wars X-wing robotu, genç Jedi’ların kolayca inşa edebileceği şekilde tasarlanmıştır. Görüntüyü 3 boyutlu yakınlaştırma ve döndürme araçlarına sahip ve model severlerin ilerlemelerini takip etmelerine ve setleri kaydetmelerine olanak tanıyan LEGO Builder uygulamasıyla yaratıcı deneyimlerini zenginleştirin. Luke Skywalker X-Wing Robotu, hızlıca inşa edilebilen koleksiyonluk LEGO Star Wars robotları (ayrı satılır) serisinin bir parçasıdır.;

Hızlıca inşa edilen LEGO Star Wars™ Luke Skywalker robot oyuncağı – Oynamak ve sergilemek için kolayca inşa edilen bu Luke Skywalker X-Wing Robotu ile çocukları LEGO® Star Wars evreniyle tanıştırın;
Bir Luke Skywalker LEGO® minifigürü – Bu simgeleşmiş Star Wars™ karakterinin LEGO minifigürü, hayali aksiyon oyunları için bir ışın kılıcı ve blaster silahıyla birlikte gelir;
İnşa edilebilen LEGO® X-wing robot zırhı – Robotun duruşu ayarlanabilir elleri, kolları, bacakları ve ayakları, açılan bir minifigür kokpiti ve ayarlanabilir X-wing jet çantası, ayrıca büyük bir ışın kılıcı ve mermi atan blasteri bulunur;
LEGO® Star Wars™ koleksiyonluk – Bu inşa edilebilen robot oyuncağı, ayrı satılan LEGO Star Wars robot koleksiyonunun bir parçasıdır;
6 yaş ve üzeri çocuklar için LEGO® Star Wars™ hediyesi – Parçalarla inşa edilen bu LEGO robot oyuncağı, yaratıcı erkek ve kız çocuklar ve tüm genç Star Wars hayranları için eğlenceli bir hediyedir;
Sezgisel talimatlar – LEGO® Builder uygulaması, çocuğunuzun modelini inşa ederken 3 boyutlu dijital bir versiyonunu yakınlaştırmasını ve döndürmesini sağlayan araçlar içerir;
Her yaş için yaratıcı yapım oyuncakları – Çocuklar ve yetişkin Star Wars™ hayranları, koleksiyonluk LEGO® Star Wars setleriyle kendi hikayelerini oluşturabilir veya inşa edilebilen modelleri sergileyebilir;
Aksiyon ve sergilemek için yapıldı – Bu 195 parçalı setteki inşa edilebilen Luke Skywalker X-Wing Robotu oyuncağının boyu 13 cm’dir ve oyun görevleri arasında sergilenebilir;

